import styled from 'styled-components';


export const List = styled.ol`
  padding: 20px;
  overflow-y: hidden;
  font-size: 16px;
  font-weight: 400;
  border-radius: 5px;
  background-color: grey};
  box-shadow: 0px 1px 3px rgba(0, 0, 0, 0.22), 0px 2px 2px rgba(0, 0, 0, 0.24),
    0px 2px 1px rgba(0, 0, 0, 0.32);
`;
